  });

  return (
    <BrowserRouter>
       <nav
       className='home-navbar'>
           <Link to='/' className='first'>#VANLIFE</Link>
           <Link to='/about'>About</Link>
           <Link to='/vans'>Vans</Link>
       </nav>
       <Routes>
          <Route path="/" element={<Home />} />
